export const rightToc = [{
  value: '先决条件',
  id: '先决条件',
  children: []
}, {
  value: '局限性',
  id: '局限性',
  children: []
}, {
  value: '创建一个 CCE 集群',
  id: '创建一个-cce-集群',
  children: []
}];
const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p><em parentName="p">{`从 v2.2.0 开始可用`}</em></p>
    <p>{`您可以使用 Rancher 创建一个托管于 华为云容器引擎（CCE）中的集群。Rancher 已经为 CCE 实现并打包了针对 CCE 的`}<a parentName="p" {...{
        "href": "/docs/rancher2/admin-settings/drivers/cluster-drivers/_index"
      }}>{`集群驱动`}</a>{`，但是默认情况下，这个集群驱动是`}<inlineCode parentName="p">{`未启用的`}</inlineCode>{`。为了启动 CCE 集群，您需要先`}<a parentName="p" {...{
        "href": "/docs/rancher2/admin-settings/drivers/cluster-drivers/_index"
      }}>{`启用 CCE 集群驱动程序`}</a>{`。启用集群驱动后，才可以开始配置 CCE 集群。`}</p>
    <h3 {...{
      "id": "先决条件"
    }}>{`先决条件`}</h3>
    <blockquote>
      <p parentName="blockquote"><strong parentName="p">{`注意`}</strong>{`
部署到 CCE 将会产生费用。`}</p>
    </blockquote>
    <ol>
      <li parentName="ol">
        <p parentName="li">{`在华为 CCE 门户中查找您的项目 ID，详情请参考关于如何`}<a parentName="p" {...{
            "href": "https://support.huaweicloud.com/api-iam/iam_17_0002.html"
          }}>{`获取华为云账号、IAM 用户、项目、用户组、区域、委托的名称和 ID`}</a>{`的文档。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`创建`}<a parentName="p" {...{
            "href": "https://support.huaweicloud.com/api-iam/iam_03_0001.html"
          }}>{`访问密钥`}</a>{`.`}</p>
      </li>
    </ol>
    <h3 {...{
      "id": "局限性"
    }}>{`局限性`}</h3>
    <p>{`华为 CCE 服务不支持通过 API 创建具有公共访问权限的集群。您需要在与要配置的 CCE 集群相同的 VPC 中运行 Rancher Server。`}</p>
    <h3 {...{
      "id": "创建一个-cce-集群"
    }}>{`创建一个 CCE 集群`}</h3>
    <ol>
      <li parentName="ol">
        <p parentName="li">{`从 `}<strong parentName="p">{`集群`}</strong>{` 页面，单击 `}<strong parentName="p">{`添加集群`}</strong>{`。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`选择 `}<strong parentName="p">{`华为 CCE`}</strong>{`。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`输入 `}<strong parentName="p">{`集群名称`}</strong>{`。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`通过`}<strong parentName="p">{`成员角色`}</strong>{`来设置用户访问集群的权限。`}</p>
        <ul parentName="li">
          <li parentName="ul">{`单击`}<strong parentName="li">{`添加成员`}</strong>{`将需要访问这个集群的用户添加到成员中。`}</li>
          <li parentName="ul">{`在`}<strong parentName="li">{`角色`}</strong>{`下拉菜单中选择每个用户的权限。`}</li>
        </ul>
      </li>
      <li parentName="ol">
        <p parentName="li">{`输入 `}<strong parentName="p">{`项目 ID`}</strong>{`，访问密钥 ID`}<strong parentName="p">{`Access Key`}</strong>{`和访问密钥`}<strong parentName="p">{`Secret Key`}</strong>{`。然后单击`}<strong parentName="p">{`下一步：配置集群`}</strong>{`。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`填写以下集群配置：`}</p>
        <table parentName="li">
          <thead parentName="table">
            <tr parentName="thead">
              <th parentName="tr" {...{
                "align": "left"
              }}>{`设置`}</th>
              <th parentName="tr" {...{
                "align": "left"
              }}>{`描述`}</th>
            </tr>
          </thead>
          <tbody parentName="table">
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`集群类型`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`您要包含在集群中的类型或节点，`}<inlineCode parentName="td">{`虚拟机`}</inlineCode>{` 或 `}<inlineCode parentName="td">{`裸机`}</inlineCode>{` 。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`描述`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`集群的描述。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`主版本`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`Kubernetes 版本。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`管理规模计数`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`集群的最大节点计数。选项有 50、200 和 1000。规模越大，成本就越高。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`高可用性`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`启用主节点高可用性。启用高可用性的集群将具有更高的成本。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`容器网络模式`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`集群中使用的网络模式。`}<inlineCode parentName="td">{`虚拟机`}</inlineCode>{` 类型支持 `}<inlineCode parentName="td">{`overlay-l2`}</inlineCode>{` 和 `}<inlineCode parentName="td">{`vpc-router`}</inlineCode>{` ，`}<inlineCode parentName="td">{`裸机`}</inlineCode>{` 类型支持 `}<inlineCode parentName="td">{`underlay-ipvlan`}</inlineCode></td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`容器网络 CIDR`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`集群的网络 CIDR。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`VPC 名称`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`要部署集群的 VPC 名称。如果为空，Rancher 将创建一个。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`子网名称`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`集群将部署到的子网名称。如果空白，Rancher 将创建一个。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`外部服务器`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`该选项是为将来保留的，我们可以通过 API 启用 CCE 集群公共访问。目前，它始终处于禁用状态。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`集群标签`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`集群的标签。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`高速子网`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`此选项仅在 `}<inlineCode parentName="td">{`裸机`}</inlineCode>{` 类型时可用。它要求您为裸机选择一个高速网络的 VPC。`}</td>
            </tr>
          </tbody>
        </table>
      </li>
      <li parentName="ol">
        <p parentName="li">{`填写集群的以下节点配置:`}</p>
        <table parentName="li">
          <thead parentName="table">
            <tr parentName="thead">
              <th parentName="tr" {...{
                "align": "left"
              }}>{`设置`}</th>
              <th parentName="tr" {...{
                "align": "left"
              }}>{`描述`}</th>
            </tr>
          </thead>
          <tbody parentName="table">
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`区域`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`集群节点所在的可用区域。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`计费方式`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`集群节点的计费方式。在 `}<inlineCode parentName="td">{`虚拟机`}</inlineCode>{` 类型中，仅支持 `}<inlineCode parentName="td">{`按使用量付费`}</inlineCode>{`。在 `}<inlineCode parentName="td">{`裸机`}</inlineCode>{` 中，您可以选择 `}<inlineCode parentName="td">{`按使用量付费`}</inlineCode>{` 或 `}<inlineCode parentName="td">{`按年/按月`}</inlineCode>{`。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`有效期`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`此选项仅在 `}<inlineCode parentName="td">{`年/月`}</inlineCode>{` 计费模式中显示。您要为集群节点支付多长时间的费用。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`自动续定`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`此选项仅在 `}<inlineCode parentName="td">{`年/月`}</inlineCode>{` 计费模式中显示。是否在集群节点到期时自动续定。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`数据卷类型`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`集群节点的数据卷类型。可选项为`}<inlineCode parentName="td">{`SATA`}</inlineCode>{` ，`}<inlineCode parentName="td">{`SSD`}</inlineCode>{`或者`}<inlineCode parentName="td">{`SAS`}</inlineCode>{`。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`数据卷大小`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`集群节点的数据卷大小。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`根卷类型`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`集群节点的根卷类型。可选项为`}<inlineCode parentName="td">{`SATA`}</inlineCode>{` ，`}<inlineCode parentName="td">{`SSD`}</inlineCode>{`或者`}<inlineCode parentName="td">{`SAS`}</inlineCode>{`。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`根卷大小`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`集群节点的根卷大小。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`节点规格`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`集群节点的节点规格。Rancher UI 中的规格列表来自华为云。它包括所有支持的节点类型。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`节点数`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`集群的节点数`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`节点操作系统`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`集群节点的操作系统。现在只支持 `}<inlineCode parentName="td">{`EulerOS 2.2`}</inlineCode>{` 和 `}<inlineCode parentName="td">{`CentOS 7.4`}</inlineCode>{`。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`SSH 密钥名`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`集群节点的 ssh 密钥`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`EIP`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`集群节点的公用 IP 选项。`}<inlineCode parentName="td">{`禁用`}</inlineCode>{`表示集群节点不会绑定公共 IP。`}<inlineCode parentName="td">{`创建EIP`}</inlineCode>{` 意味着集群节点将在配置后绑定一个或多个新创建的 EIP，并在 UI 中显示更多选项以设置创建 EIP 参数。`}<inlineCode parentName="td">{`选择已有EIP`}</inlineCode>{` 意味着节点将绑定到您选择的 EIP。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`EIP 数量`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`仅当选择 `}<inlineCode parentName="td">{`创建EIP`}</inlineCode>{` 时才会显示此选项。这意味着要为节点创建多少 EIP。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`EIP 类型`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`仅当选择 `}<inlineCode parentName="td">{`创建EIP`}</inlineCode>{` 时才会显示此选项。选项是 `}<inlineCode parentName="td">{`5_bgp`}</inlineCode>{` 和 `}<inlineCode parentName="td">{`5_sbgp`}</inlineCode>{`。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`EIP 共享类型`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`仅当选择 `}<inlineCode parentName="td">{`创建EIP`}</inlineCode>{` 时才会显示此选项。选项为`}<inlineCode parentName="td">{`PER`}</inlineCode>{`。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`EIP 收费模式`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`仅当选择 `}<inlineCode parentName="td">{`创建EIP`}</inlineCode>{` 时才会显示此选项。选择是按`}<inlineCode parentName="td">{`带宽`}</inlineCode>{`付费还是按`}<inlineCode parentName="td">{`流量`}</inlineCode>{`付费。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`EIP 带宽大小`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`仅当选择 `}<inlineCode parentName="td">{`创建EIP`}</inlineCode>{` 时才会显示此选项。EIP 的带宽。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`身份验证模式`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`启用`}<inlineCode parentName="td">{`RBAC`}</inlineCode>{`或启用`}<inlineCode parentName="td">{`认证代理`}</inlineCode>{`。如果选择 `}<inlineCode parentName="td">{`认证代理`}</inlineCode>{`，则还需要提供用于验证代理的证书。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`节点标签`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`集群节点的标签。`}</td>
            </tr>
          </tbody>
        </table>
      </li>
      <li parentName="ol">
        <p parentName="li">{`单击 `}<strong parentName="p">{`创建`}</strong>{` ，创建 CCE 集群。`}</p>
      </li>
    </ol>
    <p><strong parentName="p">{`结果：`}</strong></p>
    <ul>
      <li parentName="ul">{`您的集群创建成功并进入到`}<strong parentName="li">{`Provisioning`}</strong>{`（启动中）的状态。Rancher 正在拉起您的集群。`}</li>
      <li parentName="ul">{`在集群状态变为`}<strong parentName="li">{`Active`}</strong>{`（激活）状态后，您将可以开始访问您的集群。`}</li>
      <li parentName="ul">{`在`}<strong parentName="li">{`Active`}</strong>{`的集群中，有两个默认项目：`}<inlineCode parentName="li">{`Default`}</inlineCode>{`项目（包括`}<inlineCode parentName="li">{`default`}</inlineCode>{`命名空间）和`}<inlineCode parentName="li">{`System`}</inlineCode>{`项目（包括`}<inlineCode parentName="li">{`cattle-system`}</inlineCode>{`、`}<inlineCode parentName="li">{`ingress-nginx`}</inlineCode>{`、`}<inlineCode parentName="li">{`kube-public`}</inlineCode>{` 和 `}<inlineCode parentName="li">{`kube-system`}</inlineCode>{`）。`}</li>
    </ul>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
